import {Button, Col, Container} from 'react-bootstrap';
import './App.css';

let App = () => {
  return (
    <Container fluid>
        <h1>DocTalk</h1>
        <h2>Your online medical appointments platform!</h2>
        <Button variant='info' classname="mt-3" href='#'>Sign In!</Button>
    </Container>
  );
}

export default App;
